import { Typography, TextField, Grid, Stack, TextareaAutosize, useMediaQuery, Button, Alert } from '@mui/material';
import React, { useState } from 'react';
import PhoneInput from "react-phone-input-2";
import '../App.css';
import 'react-phone-input-2/lib/style.css'
import { useTranslation } from 'react-i18next';

export default function PersonalInfo({name,setName,gender,selectedGender,setselectedGender,phone,
    setPhone,birthday,setBirthday,email,setEmail,lastName,setLastName}){

    const { t } = useTranslation();
  return (
    <div style={{marginTop:'30px'}}>
        <Stack direction='row' gap={7}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("First Name")}
            </label>
            <TextField
              value={name}
              onChange={(e) => { setName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Last Name")}
            </label>
            <TextField
              value={lastName}
              onChange={(e) => { setLastName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>
          </Stack>


          <Stack direction='row' gap={7} sx={{marginTop:'20px'}}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Gender")}
            </label>
            <TextField
              value={name}
              onChange={(e) => { setName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Last Name")}
            </label>
            <TextField
              value={lastName}
              onChange={(e) => { setLastName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>
          </Stack>
    </div>
  )
}
